import styles from "../styles/_about.module.scss";

import Header from "./Header";

const About = () => {
    return (
        <>
            <Header />
            <div className={styles.flex_container}>
                <div className={styles.flex_item_opening}>
                    &lt;div id= "about" &gt;
                </div>
                <div className={styles.flex_item_content}>
                    Born in Poland in 1986, I came to Germany a few years later
                    with my parents and just two suitcases. Many years later I
                    graduated in{" "}
                    <span className={styles.span}>communication design</span>,
                    worked in retail for years and opened my own kids concept
                    store. My heart definitely beats for{" "}
                    <span className={styles.span}>pretty things</span>. Also for{" "}
                    <span>design</span>. And for
                    <span> code</span>.
                </div>
                <div className={styles.flex_item_closing}>&lt;/div&gt;</div>
            </div>
        </>
    );
};

export default About;
